import React from "react";

export default function Lists({ lists, setTasks }) {
  function changeList() {
    setTasks();
  }
  return (
    <div className="listsContainer">
      {lists.map((list) => (
        <div onClick={(e) => changeList(e)}> {list.name} </div>
      ))}
    </div>
  );
}
